            )}
          </p>
          <p>
            {finishInstallation
              ? "Estás usando la Web App"
              : "Aplicación todavía no instalada"}
          </p>
        </div> */}

        <AboutMe />

        <Portfolio />

        <Contact />

        <Footer />
      </main>
    </Fragment>
  );
}

export default App;
